import React from 'react';
import { navigate } from 'react-router-dom';

const Home = ({ navigate, token }) => {
    return (
        <div>
            <h3>See all postings!</h3>
            <div className='addButtonContainer'>
                <button className='addButton' onClick={() => navigate('/posts')} />
            </div>
        </div>
    )
}

export default Home;
